import React, { Component } from "react";
import { MDBTable, MDBTableBody, MDBTableHead } from "mdbreact";

import antiStaticBags from "./product-data/bags/antiStaticBags";
console.log(antiStaticBags);

class App extends Component {
	state = {
		antiStaticBags: antiStaticBags
	};
	render() {
		return (
			<MDBTable striped>
				<MDBTableHead>
					<tr>
						<th>Product Number</th>
						<th>Durability</th>
						<th>Size</th>
						<th>Weight</th>
						<th>Bags Per Case</th>
					</tr>
				</MDBTableHead>
				<MDBTableBody>
					<tr>
						{antiStaticBags.map(function(name, index) {
							return <th key={index}>{name.productNumber}</th>;
						})}
					</tr>
				</MDBTableBody>
			</MDBTable>
		);
	}
}

export default App;
